import React, { Component } from 'react';

class Requirements extends Component {
    render() {
        return (
            <div>
                <h1>Requirements</h1>
                <p>First step to getting your dog enrolled in our doggy daycare, boarding or grooming, is take to make sure he/she is up to date on their shots. We require every dog that stays at Zinky</p>
            </div>
        );
    }
}

export default Requirements;
